        private void btnTestSave_Click(object sender, EventArgs e)
        {
            Cursor = Cursors.WaitCursor;

            if (rbtLocal.Checked)
            {
                if (cboInstanceConnection.SelectedIndex > -1)
                {
                    //string stConnectionString = "Server = " + cboInstanceConnection.SelectedItem.ToString() + "; database = "+Preferences.DatabaseName+"; integrated security = yes";

                    //if (Business.Business.SelectCountAllUsers(Data.Data.GetConnectionString(cboInstanceConnection.SelectedItem.ToString())) > 0)
                    if (Business.Business.SelectCountAllUsers(cboInstanceConnection.SelectedItem.ToString()) > 0)
                    {
                        Settings.Default["Local"] = rbtLocal.Checked ? true : false;
                        Settings.Default["Instance"] = cboInstanceConnection.Text;

                        Settings.Default.Save();

                        MessageBox.Show("The connection test was did successful.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Information);

                        oForm_002.Show();
                        Close();
                    }
                    else
                    {
                        MessageBox.Show("The connection could not be established. We ask that:\r\n• Verify that the SQL Server engine is turned on\r\n• Verify that the data structure is correctly installed.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                        cboInstanceConnection.Focus();
                    }
                }
                else
                {
                    MessageBox.Show("There isn't any instance selected.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                }
            }
            else
            {
                if (mskIP.Text.Split('.')[0].Length > 0 && mskIP.Text.Split('.')[1].Length > 0 && mskIP.Text.Split('.')[2].Length > 0 && mskIP.Text.Split('.')[3].Length > 0)
                {
                    if (Business.Business.SelectCountAllUsers(mskIP.Text.Split('.')[0].Trim(), mskIP.Text.Split('.')[1].Trim(), mskIP.Text.Split('.')[2].Trim(), mskIP.Text.Split('.')[3].Trim(), (Convert.ToInt32(nupdPort.Value)).ToString()) > 0)
                    {
                        Settings.Default["Local"] = rbtLocal.Checked ? true : false;
                        Settings.Default["IP"] = mskIP.Text;
                        Settings.Default["Port"] = nupdPort.Value.ToString();

                        Settings.Default.Save();

                        MessageBox.Show("The connection could not be established. We ask that:\r\n• Verify that the SQL Server engine on the server is turned on\r\n• Verify that the data structure is correctly installed on the server.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Exclamation);

                        oForm_002.Show();
                        Close();
                    }
                    else
                    {
                        MessageBox.Show("The selected ip is not correct.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                        mskIP.Focus();
                    }
                }
                else
                {
                    MessageBox.Show("The selected ip is not correct.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Exclamation);

                    mskIP.Focus();
                }
            }

            Cursor = Cursors.Default;
        }

        private void btnInstall_Click(object sender, EventArgs e)
        {
            //string stPath = Preferences.ArchitectDatabase64 ? "dependencies\\SQL_Server_2014_Express_64_Bit_ENU.exe" : "dependencies\\SQL_Server_2014_Express_32_Bit_ENU.exe";
            string stPath = PreferencesStraad.ArchitectDatabase64 ? "C:\\DELET\\QL_Server_2014_Express_64_Bit_ENU.exe" : "C:\\DELET\\SQL_Server_2014_Express_32_Bit_ENU.exe";// ONLY TEST

            if (File.Exists(stPath))
            {
                if (MessageBox.Show("Do you want to start the installation of Microsoft SQL Server? this may take awhile.", PreferencesStraad.TitleSoftware, MessageBoxButtons.YesNo, MessageBoxIcon.Information, MessageBoxDefaultButton.Button2) == DialogResult.Yes)
                {
                    Process oProcess = new Process();

                    if (rbtAutomatic.Checked)
                        oProcess = SQLServer.zmct(stPath, true);
                    else if (rbtManual.Checked)
                        oProcess = SQLServer.zmct(stPath, false);
                    else
                        oProcess.StartInfo = new ProcessStartInfo(stPath);

                    try
                    {
                        btnInstall.Enabled = false;
                        oProcess.Start();
                        oProcess.WaitForExit();

                        cboInstanceConnection.Items.Clear();
                        cboInstanceMaintenance.Items.Clear();

                        UpdateInstances();
                    }
                    catch
                    {
                        MessageBox.Show("There was a problem with the MSSQL wizard.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
                    }
                }

                btnInstall.Enabled = true;
            }
            else
            {
                MessageBox.Show("MSSQL installer could not be found.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Exclamation);
            }
        }

        private void cboInstanceMaintenance_TabIndexChanged(object sender, EventArgs e)
        {
            Cursor = Cursors.WaitCursor;

            if (Business.Business.SelectCountDatabases(cboInstanceMaintenance.SelectedItem.ToString()) == 1)
            {
                btnCreate.Enabled = false;
                btnBackUp.Enabled = true;
                btnRestore.Enabled = false;
                btnDelete.Enabled = true;
            }
            else
            {
                btnCreate.Enabled = true;
                btnBackUp.Enabled = false;
                btnRestore.Enabled = true;
                btnDelete.Enabled = false;
            }

            Cursor = Cursors.Default;
        }

        private void btnBackUp_Click(object sender, EventArgs e)
        {
            if (MessageBox.Show("Do you want to back up the database of the application?", PreferencesStraad.TitleSoftware, MessageBoxButtons.YesNo, MessageBoxIcon.Information) == DialogResult.Yes)
            {
                if (!Directory.Exists(stPath))
                    Directory.CreateDirectory(stPath);
                else
                    if (File.Exists(stTemporalFile))
                    File.Delete(stTemporalFile);

                SaveFileDialog obSaveFileDialog = new SaveFileDialog();
                obSaveFileDialog.Filter = "BAK |*.bak";
                obSaveFileDialog.InitialDirectory = stPath;
                obSaveFileDialog.FileName = GetFileName();

                if (DialogResult.OK == obSaveFileDialog.ShowDialog(this))
                {
                    Cursor = Cursors.WaitCursor;

                    try
                    {
                        string stConnectionString = "Server = " + cboInstanceMaintenance.SelectedItem.ToString() + "; database = master; integrated security = yes";

                        Business.Business.Execute("USE master; BACKUP DATABASE " + PreferencesStraad.DatabaseName + " TO DISK = N'" + stTemporalFile + "' WITH NOFORMAT, NOINIT, NAME = N'test-Completa Base de datos Copia de seguridad', SKIP, NOREWIND, NOUNLOAD, STATS = 10;", stConnectionString);

                        File.Copy(stTemporalFile, obSaveFileDialog.FileName);
                        File.Delete(stTemporalFile);

                        Cursor = Cursors.Default;

                        MessageBox.Show("The strcuture of system has been successfully backed.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                    catch (Exception obException)
                    {
                        Cursor = Cursors.Default;

                        MessageBox.Show("Failed to support the structure of the system, verify the user's credentials or try to save the copy on ..\\Microsoft SQL Server\\MSSQL12.MSSQLSERVER\\MSSQL\\Backup\\." + "\r\n\n " + obException.Message, PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Error);
                    }
                }
            }
        }

