        private void btnRestore_Click(object sender, EventArgs e)
        {
            if (MessageBox.Show("Do you want to restore the database on this instance?", PreferencesStraad.TitleSoftware, MessageBoxButtons.YesNo, MessageBoxIcon.Information) == DialogResult.Yes)
            {
                if (!Directory.Exists(stPath))
                    Directory.CreateDirectory(stPath);
                else
                    if (File.Exists(stTemporalFile))
                    File.Delete(stTemporalFile);

                OpenFileDialog obOpenFileDialog = new OpenFileDialog();
                obOpenFileDialog.Filter = "BAK |*.bak";
                obOpenFileDialog.InitialDirectory = stPath;
                obOpenFileDialog.FileName = "";

                if (DialogResult.OK == obOpenFileDialog.ShowDialog(this))
                {
                    Cursor = Cursors.WaitCursor;

                    string stPrePath;
                    if (PreferencesStraad.ArchitectDatabase64)
                    {
                        stPrePath = "C:\\Program Files\\Microsoft SQL Server";
                    }
                    else
                    {
                        if (Directory.Exists("C:\\Program Files (x86)\\Microsoft SQL Server"))
                            stPrePath = "C:\\Program Files (x86)\\Microsoft SQL Server";
                        else
                            stPrePath = "C:\\Program Files\\Microsoft SQL Server";
                    }

                    File.Copy(obOpenFileDialog.FileName, stTemporalFile);

                    string stConnectionString = "Server = " + cboInstanceMaintenance.SelectedItem.ToString() + "; database = master; integrated security = yes";

                    string stErrorCode = "";
                    if (stErrorCode.Length == 0 && !Business.Business.Execute("USE master; RESTORE DATABASE " + PreferencesStraad.DatabaseName + " FROM  DISK = N'" + stTemporalFile + "' WITH  FILE = 1,  MOVE N'" + PreferencesStraad.DatabaseName + "' TO N'" + stPrePath + "\\MSSQL12." + cboInstanceMaintenance.SelectedItem.ToString().Split('\\')[1] + "\\MSSQL\\DATA\\" + PreferencesStraad.DatabaseName + ".mdf',  MOVE N'" + PreferencesStraad.DatabaseName + "_log' TO N'" + stPrePath + "\\MSSQL12." + cboInstanceMaintenance.SelectedItem.ToString().Split('\\')[1] + "\\MSSQL\\DATA\\" + PreferencesStraad.DatabaseName + ".ldf',  NOUNLOAD,  STATS = 5;", stConnectionString))
                        stErrorCode = "A";
                    if (stErrorCode.Length == 0 && !Business.Business.Execute("USE [" + PreferencesStraad.DatabaseName + "]; DROP USER [" + PreferencesStraad.UserDatabase + "];", stConnectionString))
                        stErrorCode = "B";
                    if (stErrorCode.Length == 0 && !Business.Business.Execute("USE " + PreferencesStraad.DatabaseName + "; CREATE LOGIN " + PreferencesStraad.UserDatabase + " WITH PASSWORD = N'" + PreferencesStraad.PasswordDatabaseUser + "', DEFAULT_DATABASE = [" + PreferencesStraad.DatabaseName + "], DEFAULT_LANGUAGE = [Español], CHECK_EXPIRATION = OFF, CHECK_POLICY = OFF; CREATE USER " + PreferencesStraad.UserDatabase + " FOR LOGIN [" + PreferencesStraad.UserDatabase + "]; ALTER ROLE [db_datareader] ADD MEMBER [" + PreferencesStraad.UserDatabase + "]; ALTER ROLE [db_datawriter] ADD MEMBER [" + PreferencesStraad.UserDatabase + "];", stConnectionString))
                        stErrorCode = "C";

                    if (stErrorCode.Length == 0)
                    {

                        File.Delete(stTemporalFile);

                        btnCreate.Enabled = false;
                        btnBackUp.Enabled = true;
                        btnRestore.Enabled = false;
                        btnDelete.Enabled = true;

                        MessageBox.Show("The structure of the system has been successfully restored.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                    else
                    {
                        MessageBox.Show("Failed to restore the system structure  (" + stErrorCode + "), check user credentials or try to open the copy from\r\n\nC:\\.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Error);
                    }

                    Cursor = Cursors.Default;
                }
            }
        }

        private void btnDelete_Click(object sender, EventArgs e)
        {
            if (MessageBox.Show("Do you want to delete the database of the application?", PreferencesStraad.TitleSoftware, MessageBoxButtons.YesNo, MessageBoxIcon.Information) == DialogResult.Yes)
            {
                Cursor = Cursors.WaitCursor;

                string stConnectionString = "Server = " + cboInstanceMaintenance.SelectedItem.ToString() + "; database = master; integrated security = yes";

                if (Business.Business.Execute("USE master; SET NOCOUNT ON DECLARE @DBName varchar(50) DECLARE @spidstr varchar(8000) DECLARE @ConnKilled smallint SET @ConnKilled = 0 SET @spidstr = '' SET @DBName = '" + PreferencesStraad.DatabaseName + "' IF db_id(@DBName) < 4 BEGIN RETURN END SELECT @spidstr = COALESCE(@spidstr,',' ) + 'kill '+ CONVERT(varchar, spid) + '; ' FROM master..sysprocesses WHERE dbid = db_id(@DBName) IF LEN(@spidstr) > 0 BEGIN EXEC(@spidstr) SELECT @ConnKilled = COUNT(1) FROM master..sysprocesses WHERE dbid = db_id(@DBName) END; USE master; DROP LOGIN " + PreferencesStraad.UserDatabase + "; DROP DATABASE " + PreferencesStraad.DatabaseName + ";", stConnectionString))
                {
                    btnCreate.Enabled = true;
                    btnBackUp.Enabled = false;
                    btnRestore.Enabled = true;
                    btnDelete.Enabled = false;

                    Cursor = Cursors.Default;

                    MessageBox.Show("The structure of system has been deleted succesfull.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Information);
                }
                else
                {
                    Cursor = Cursors.Default;

                    MessageBox.Show("Failed to destroy the structure of system.", PreferencesStraad.TitleSoftware, MessageBoxButtons.OK, MessageBoxIcon.Error);
                }
            }
        }

        private void UpdateInstances()
        {
            string[] staInstances = SQLServer.fjol();

            if (staInstances != null)
            {
                foreach (string s in staInstances)
                {
                    string[] aux = s.Split('\\');
                    if (aux.Length == 2 && aux[aux.Length - 1].Substring(0, 6) == "STRAAD" && !aux[aux.Length - 1].Contains('_'))
                    {
                        cboInstanceConnection.Items.Add(s);
                        cboInstanceMaintenance.Items.Add(s);
                    }
                }

                if (cboInstanceConnection.Items.Count > 0)
                    cboInstanceConnection.SelectedIndex = cboInstanceMaintenance.SelectedIndex = cboInstanceConnection.Items.Count - 1;
            }
        }

        private void AdjustRadioButtons()
        {
            if (rbtLocal.Checked)
            {
                lblInstance.Visible = cboInstanceConnection.Visible = true;
                lblIP.Visible = mskIP.Visible = lblPort.Visible = nupdPort.Visible = false;
                cboInstanceConnection.Focus();
            }
            else
            {
                lblInstance.Visible = cboInstanceConnection.Visible = false;
                lblIP.Visible = mskIP.Visible = lblPort.Visible = nupdPort.Visible = true;
                mskIP.Focus();
            }
        }

        private string GetFileName()
        {
            int inDay = DateTime.Now.Day;
            int inMonth = DateTime.Now.Month;
            int inHour = DateTime.Now.Hour;
            int inMinute = DateTime.Now.Minute;
            int inSecond = DateTime.Now.Second;

            return PreferencesStraad.DatabaseName + "_" + DateTime.Now.Year + "_" + (inHour < 10 ? "0" + inHour : inHour.ToString()) + "-" + (inMinute < 10 ? "0" + inMinute : inMinute.ToString()) + "-" + (inMonth < 10 ? "0" + inMonth : inMonth.ToString()) + "-" + (inDay < 10 ? "0" + inDay : inDay.ToString()) + "-" + (inSecond < 10 ? "0" + inSecond : inSecond.ToString());
        }

